import React, { Component } from 'react';
import {
  Header,
  Image
}
  from 'semantic-ui-react';
import { Slide, Swiper } from 'react-dynamic-swiper';
import logo from '../../public/images/dzvun-logo.jpg';


class Body extends Component {
  renderNotLogged = () => {
    return (
      <Header as='h1' textAlign='center'>
        Hi
      </Header>
    );
  }
  renderLogged = () => {
    return (
      <Header as='h1' textAlign='center'>
        Heyyyyy
      </Header>
    );
  }
  render() {

    const isLogged = this.props.isLogged;

    return (
      <div>
        {isLogged ?
          <div>
            {this.renderLogged()}
          </div>
          :
          <div>
            {this.renderNotLogged()}
          </div>
        }
        <Swiper
          swiperOptions={{
            slidesPerView: 42,
          }}
          navigation={false}
          pagination={false}
        >
          <Slide onActive={swiper => console.log('Slide Active!')} >
            <Image src={logo} />
          </Slide>
        </Swiper>
      </div>

    )
  }
}
export default Body;
